**1. Dead Code Elimination**

Dead code elimination is a technique where the compiler removes code that doesn't affect the program's output. This can happen when a variable is assigned a value but never used, or when a conditional statement always evaluates to the same value.

Example:
```c
int foo() {
    int x = 5;
    if (false) {
        x = 10;
    }
    return x; // x is always 5
}
```
The compiler can eliminate the `if` statement and the assignment `x = 10;` because they don't affect the program's output.

**2. Constant Folding and Propagation**

Constant folding and propagation involve evaluating constant expressions at compile-time and propagating the results throughout the code.

Example:
```c
int foo() {
    int x = 2 + 3; // constant folding: x = 5
    int y = x * 4; // constant propagation: y = 5 * 4 = 20
    return y;
}
```
The compiler can evaluate the constant expression `2 + 3` and replace it with the result `5`. Then, it can propagate the result to the next line, replacing `x` with `5` in the expression `x * 4`.

**3. Loop Unrolling**

Loop unrolling involves increasing the number of iterations in a loop to reduce the overhead of loop control statements.

Example:
```c
