```typescript
class Container<T> {
  private value: T;

  constructor(value: T) {
    this.value = value;
  }

  getValue(): T {
    return this.value;
  }
}
```
In this example, T is a type parameter that represents the type of the value stored in the Container class.

2. **any**: any is a type that represents any value, including null and undefined. It's often used when you don't know the type of a value or when you want to opt-out of type checking for a specific variable or property. For example:
```typescript
let foo: any = 'hello';
foo = 42; // okay, foo can be reassigned to any type
```
Using any can be useful, but it can also lead to type errors and make your code less maintainable.

